class Solution:

    def lengthOfLongestSubstring(self, s: str) -> int:
        found = {}
        max_length: int = 0
        l = 0
        for i in range(len(s)):
            if s[i] not in found:
                max_length = max(max_length, i-l+1)
            else:
                if found[s[i]] < l:
                    max_length = max(max_length, i-l+1)
                else:
                    l = found[s[i]] + 1
            found[s[i]] = i
            
        return max_length

